import React from 'react'
import style from "./style.css"
export default function Tutorials() {

    var question = document.querySelectorAll(".ques-header");
var ques1 = document.querySelector(".ques1");
var ques2 = document.querySelector(".ques2");
var ques3 = document.querySelector(".ques3");

question[1].addEventListener("click", function(){
    ques1.style.display = "none";
    ques2.style.display = "block";
    ques3.style.display = "none";
    this.classList.add("ques-header-active");
    question[0].classList.remove("ques-header-active");
    question[2].classList.remove("ques-header-active");
});

question[2].addEventListener("click", function(){
    ques1.style.display = "none";
    ques2.style.display = "none";
    ques3.style.display = "flex";
    this.classList.add("ques-header-active");
    question[0].classList.remove("ques-header-active");
    question[1].classList.remove("ques-header-active");
});

question[0].addEventListener("click", function(){
    ques1.style.display = "flex";
    ques2.style.display = "none";
    ques3.style.display = "none";
    this.classList.add("ques-header-active");
    question[1].classList.remove("ques-header-active");
    question[2].classList.remove("ques-header-active");
});


function sendEmail() 
{
    window.location = "mailto:abc@greenDelight.com";
}

var btn = document.querySelector(".ok");

var answers = ["#WhyGD", "#Seller", "#facilities", "#techSup", "WhyBuyfromus.html"];

btn.addEventListener("click", run);
function run(){
    var option_selected= document.getElementById("asst").value;
    var reply, linnk = "";
    var question = document.getElementById("question");
    
    if(option_selected == "Why Green Delight?")
    {
        reply = answers[0];
        linnk = answers[0];
    }
        
    if(option_selected == "I am new seller, how to use your website?")
    {
        reply = answers[1];
        linnk = answers[1];
    }
    if(option_selected == "I want to know about Government facilities")
    {
        reply = answers[2];
        linnk = answers[2];
    }
    if(option_selected == "What technical improvement can be done to increase yield?")
    {
        reply = answers[3];
        linnk = answers[3];
    }
    if(option_selected == "What are Growth Categories?")
    {
        reply = answers[4];
        linnk = answers[4];
    }

        var div_add_here = document.querySelector(".thingsToBeAdded");
        //customer
        div_add_here.innerHTML += "<div class='d-flex flex-row justify-content-end mb-4'><div class='p-2 me-3 border' style='border-radius: 15px; background-color: #fbfbfb;'><p class=small mb-0'>"+ option_selected +"</p></div><img src='https://udayananetworking.unud.ac.id/assets/frontend/images/user-m.png' alt='avatar 1' style='width: 45px; height: 100%;''></div>";
        //bot-reply
        div_add_here.innerHTML += "<div class='d-flex flex-row justify-content-start mb-4'><img src='https://manager.almadarisp.com/user/img/user.png' alt='avatar 1' style='width: 45px; height: 100%;'><div class='p-2 ms-3' style='border-radius: 15px; background-color: #9bf5a085;'><p class='small mb-0'>This might be helpful to you. <br><a href='"+ linnk  +"'>"+ reply +"</a></p></div></div>"
    
    question.classList.add("add-ani");
}

function myFunction() {
    var chatbox = document.querySelector("#chat-wt");
    var icon = document.querySelector(".chat-btn");
    if (chatbox.style.display == "none") {
        chatbox.style.display = "block";
        icon.src = "https://friconix.com/jpg/fi-xtluxx-times-thin.jpg";
    } else {
        chatbox.style.display = "none";
        icon.src = "https://thumbs.dreamstime.com/b/chat-bubble-speech-communication-icon-isolated-green-color-social-media-stock-vector-184061959.jpg";
    }
}

const technical = {
    title: "Technical Supports",
    header: "",
    info : "Having trouble accessing your account or placing an order? Our technical support team is here to help you resolve any issues you may be experiencing. If you need assistance with using our online tools and resources, our knowledgeable technical support staff can guide you through the process step by step. Do you have questions about our organic farming practices or need help troubleshooting a problem in your garden? Our team of experts is available to provide technical support and advice. We understand that technology can be intimidating, especially when it comes to organic farming. That's why we offer user-friendly tools dedicated technical support to help you succeed in your farming endeavors. Whether you're a beginner or an experienced organic farmer, we're here to support you with technical assistance, helpful tips, and useful resources to help you grow your crops and your knowledge."
}
  return (

    <div>
       <div className="heading-quote">
        <div className="heading-q">
            <div className="quote-content" >"Organic farming is not just a different way of growing food; it is a way of living, with nature as our partner in creating a sustainable future." - Vandana Shiva</div>
        </div>
    </div>

    <div className="line"></div>

    <div className="instant-content">
        <div style={{"margin": "3rem 2rem"}} >
            <div className="card card-content card-backg" style={{"background-color": "rgba(255, 255, 255, 0.304)"}}>
                <div className="photo-info">
                    <img src="https://smefutures.s3.ap-south-1.amazonaws.com/wp-content/uploads/2023/01/12121323/How-companies-are-helping-revolutionise-Indias-agriculture-landscape-through-organic-farming.jpg" className="card-img-top" alt="..."/>
                    <div className="card-body content">
                        <h5 className="card-title heading" style={{"margin-bottom": "1rem"}}>Convert to Organic Farming</h5>
                        <p className="card-text green-content"><b>Switching to organic is often less complicated than you think.<br/>Green Delight offers technical support and help with organic certification.</b></p>
                        <p className="card-text">Are you considering converting from conventional to organic farming, or do you want to know more about what this would mean for you? Organic farming might be less complicated than you may think, and we find that farmers often overestimate the yield or income losses of converting. Over the decades, our team has helped many farmers to establish organic farming systems, and boost their yields under organic production. We can also guide you through the process of acquiring organic certification. 
                        </p>
                        <a href="https://www.organicresearchcentre.com/farming-organically/converting-to-organic-farming/#:~:text=Conversion%20planning&text=A%20plan%20of%20the%20farm,for%20the%20established%20organic%20farm" className="btn btn-success" style={{"margin-top": "1rem"}}>Read More</a>
                    </div>
                </div>
                <div className="vdo">
                    <iframe className="video" src="https://www.youtube.com/embed/KPh5s0vZFOI" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowfullscreen></iframe>
                </div>
                
            </div>
        </div>
        <div style={{"margin": "3rem 2rem"}}>
            <div className="card card-content card-backg" style={{"background-color": "rgb(241, 240, 240)"}}>
                <div className="photo-info">
                    <img src="https://www.euractiv.com/wp-content/uploads/sites/2/2021/05/shutterstock_1367291945-800x600.jpg" className="card-img-top" alt="..."/>
                    <div className="card-body content">
                        <h5 className="card-title heading" style={{"margin-bottom": "1rem"}}>Financial Support</h5>
                        <p className="card-text green-content"><b>Various sources of finance are available for organic farmers.</b></p>
                        <p className="card-text">
                            New farming systems also make it more challenging to find funds within conventional financial institutions. For this reason, we built a network of financial service providers which gives our farmers access to adequate financial tools and funding. Tradin itself can provide financial support for farmers we work with and, in some cases, offer crop-financing to boost working capital.
                        </p>
                        <a href="https://www.organicresearchcentre.com/farming-organically/converting-to-organic-farming/#:~:text=Conversion%20planning&text=A%20plan%20of%20the%20farm,for%20the%20established%20organic%20farm" className="btn btn-success" style={{"margin-top": "1rem"}}>Read More</a>
                    </div>
                </div>
                <div className="vdo">
                    <iframe width="560" height="315" src="https://www.youtube.com/embed/z5J-CDBpNZE" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowfullscreen></iframe>
                </div>
            </div>
        </div>
        <div style={{"margin": "3rem 2rem"}} id="techSup">
            <div className="card card-content card-backg" style={{"background-color": "rgb(241, 240, 240)"}}>
                <div className="photo-info">
                    <img src="https://www.tradinorganic.com/_next/image?url=https%3A%2F%2Fwww.tradinorganic.com%2Fmedia%2Ffiler_public%2F9d%2F05%2F9d0593e1-9796-4cce-9800-08f8e2558822%2Fdino1.jpg&w=1920&q=75" className="card-img-top" alt="..."/>
                    <div className="card-body content">
                        <h5 className="card-title heading" style={{"margin-bottom": "1rem"}}>Technical Support</h5>
                        <p className="card-text green-content"><b>Do you have questions about our organic farming practices or need help troubleshooting a problem in your garden? Our team of experts is available to provide technical support and advice.</b></p>
                        <p className="card-text">
                            We understand that technology can be intimidating, especially when it comes to organic farming. That's why we offer user-friendly tools and dedicated technical support to help you succeed in your farming endeavors.
                            Whether you're a beginner or an experienced organic farmer, we're here to support you with technical assistance, helpful tips, and useful resources to help you grow your crops and your knowledge.
                        </p>
                        <a href="https://www.organicresearchcentre.com/farming-organically/converting-to-organic-farming/#:~:text=Conversion%20planning&text=A%20plan%20of%20the%20farm,for%20the%20established%20organic%20farm" className="btn btn-success" style={{"margin-top": "1rem"}}>Read More</a>
                    </div>
                </div>
                <div className="vdo"><iframe className="video" src="https://www.youtube.com/embed/LGF33NN4B8U" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share" allowfullscreen></iframe></div>
            </div>
        </div>
    </div>

    <div className="line"></div>
   
    <div className="icon-selectors">
        <div className="topic-icon-outer">
            <img className="topic-icon" src="/images/IMG-20230313-WA0052.jpg" style={{"width": "10rem"}}/>
            <div className="topic-icon-heading">Develop</div>
        </div>
        <div className="topic-icon-outer">
            <img className="topic-icon" src="/images/IMG-20230313-WA0053.jpg" style={{"width": "10rem"}}/>
            <div className="topic-icon-heading">Grow</div>
        </div>
        <div className="topic-icon-outer">
            <img className="topic-icon" src="/images/IMG-20230313-WA0051.jpg" style={{"width": "10rem"}}/>
            <div className="topic-icon-heading">Learn</div>
        </div>
    </div>

    <div className="line"></div>

    
    <div className="question">
        <div className="ques-header ques-header-active">Why Sell Online</div>
        <div className="ques-header">Why Green Delight?</div>
        <div className="ques-header">How to be a Seller</div>
    </div>
    <div className="ques1">
        <div className="r1">
            <img className="topic-icon" src="https://cdn.w600.comps.canstockphoto.com/sales-grow-chart-with-cart-drawing_csp16779900.jpg" style={{"width": "8rem", "height": "8rem"}}/>
            <div className="ques-icon-heading">
                <b style={{"display": "block", "text-align": "center"}}> Growth in the online retail market</b>
                <br/>
                <p>Witnessing tremendous growth for the past 12 years, retailers are moving towards online selling.</p>
                <ul style={{"margin-top": "0.4rem"}}>
                    <li>Avoid huge investments.</li>
                    <li> Large customer base to sell anywhere.</li>
                </ul>
            </div>
        </div>
        <div className="r1">
            <img className="topic-icon" src="https://media.istockphoto.com/id/1200224470/vector/motorbike-delivery-man-logo-icon-symbol-vector-template.jpg?s=612x612&w=0&k=20&c=TohyHnrnHsJWj3bglwTJ7NmnX9U98x0-1aEkTiej1Xk=" style={{"width": "8rem", "height": "8rem"}}/>
            <div className="ques-icon-heading">
                <b style={{"display": "block", "text-align": "center"}}>Get orders across India</b>
                <br/>
                <p>Receive orders from every part of the country and follow the simple steps to fulfill the orders.</p>
                <ul style={{"margin-top": "0.4rem"}}>
                    <li>Simple dashboard</li>
                    <li>Sale events, advertising and promotions</li>
                </ul>
            </div>
        </div>
        <div className="r1">
            <img className="topic-icon" src="https://images.pexels.com/photos/4498136/pexels-photo-4498136.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=500" style={{"width": "8rem", "height": "8rem"}}/>
            <div className="ques-icon-heading">
                <b style={{"display": "block", "text-align": "center"}}>Ship with ease</b>
                <br/>
                <p>Enjoy easy pick-up and delivery across India with Newkart, our logistics partner.</p>
                <ul style={{"margin-top": "0.4rem"}}>
                    <li>Efficient pick-up network</li>
                    <li>Professional packaging support</li>
                </ul>
            </div>
        </div>
        <div className="r1">
            <img className="topic-icon" src="https://www.pngall.com/wp-content/uploads/7/Budget-PNG-File.png" style={{"width": "8rem", "height": "8rem"}}/>
            <div className="ques-icon-heading">
                <b style={{"display": "block", "text-align": "center"}}>Earn big</b>
                <br/>
                <p>Our payments process is the fastest in the industry - get your payments in as little as 7 days of sales.</p>
                <ul style={{"margin-top": "0.4rem"}}>
                    <li>Fastest payment settlement</li>
                    <li>Detailed reports to track your payments</li>
                </ul>
            </div>
        </div>
    </div>
    <div className="ques2" id="WhyGD">
        <div className="advantages">
            <div className="adv-heading">
                <div className="r1 r2">
                    <img className="topic-icon" src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSF5I7qmzWWrXW3K1UNkKZGd8jOGg0-8ZZtKQ&usqp=CAU" style={{"width": "8rem", "height": "8rem", "margin-right": "1rem"}}/>
                    <div className="ques-icon-heading">
                        <b style={{"display": "block", "text-align": "center"}}> Growth</b>
                        <br/>
                        <p>Widen your reach to a customer base of 1 billion and grow your business further with the support of Account managers.</p>
                        <br/>
                        <a href="">Learn More</a>
                    </div>
                </div>
            </div>
            <div className="adv-heading">
                <div className="r1 r2">
                    <img className="topic-icon" src="https://pbs.twimg.com/profile_images/907939349005774848/sMjE0I3r_400x400.jpg" style={{"width": "8rem", "height": "8rem", "margin-right": "1rem"}}/>
                    <div className="ques-icon-heading">
                        <b style={{"display": "block", "text-align": "center"}}>Ease</b>
                        <br/>
                        <p>You just need your product and two documents to start selling on Flipkart.</p>
                        <br/>
                    </div>
                </div>
            </div>
